import React from "react";
import Home from "./Home";
import Contact from "./Contact";
import About from "./About";
import Services from "./Services";
import { Switch,Route} from "react-router-dom";


const App = () =>{
    return(
        <>
        <Switch>
            <Route></Route>
            <Route></Route>
            <Route></Route>
            <Route></Route>
            <Route></Route>
        </Switch>
        </>
    )
}

export default App;
